import React from "react";
import "./Button.css";

interface ButtonProps {
  title: string;
  type: string;
  action: ((genre: string) => void);
}
export const Button = ({ title, type }: ButtonProps) => {
  return <button className={`button__${type}`}>{title}</button>;
};
